import React from 'react';
import unsplash from '../api/unsplash';

class FormViewer extends React.Component{
    constructor(props){
        super(props);
        this.state={
            id:props.match.params.id,
            Schema:''

        }
    }
async componentDidMount(){
    const FormSchema=await unsplash.get('/getFormSchema',{
        id: this.state.id
    }).then((response)=> {
        console.log("successfully: ", response);
     }).catch((error)=> {
        console.log("got errr while getting data", error);
     });

    var Schema=[];

    for(var i=0;i<FormSchema.data.length;i++)
    {
        Schema=(JSON.parse(FormSchema.data[i].formSchema));
        
        this.setState(prevState => ({
            Schema: [...prevState.Schema,{Schema}]
          }))
    }
}
    render(){
        return(
            <div className="ui segment">
            {this.state.Schema}
            </div>
        );
    }
}

export default FormViewer;
